import React from 'react';

const Calulate = ({selectedVehicle, vehicles}) => {
  const selectedVehicleOb = Object.values(selectedVehicle)

  console.log("selectedVehicleOb")
  console.log(selectedVehicleOb)

  const getTime = () =>{
    console.log("selectedVehicle.length")
    console.log(Object.values(selectedVehicle).length)
    let timeTaken = 0;
    for(let i =0; i < selectedVehicleOb.length; i++){
      var timeTakenPerV = 0;
      console.log(" this is i")
      console.log(selectedVehicleOb[i])
      // match the list to get ditance and speed
      let vehicle = vehicles.filter(obj => {
        return obj.name === selectedVehicleOb[i]
      })

      console.log(vehicle.max_distance)
      timeTakenPerV = vehicle[0].max_distance/vehicle[0].speed

      timeTaken = timeTaken + timeTakenPerV

      console.log("timeTakenPerV")
      console.log(timeTakenPerV)
    }
  }

  getTime();

  return (
    <div className="missioncontroll_cal">
      <div className="missioncontroll_cal-box">
        <span className="missioncontroll_cal-label">
          Time taken :
        </span>
        <span className="missioncontroll_cal-result" selectedVehicle={selectedVehicle}>

        </span>
      </div>
    </div>
  );
}

export default Calulate;
